@jRobynNeal @Best2Q @JonathanSimon14 @jennycohn1 I’m enjoying your laugh, but online it’s actually true. 

Making something “secret” makes it into a target. It gives accessing it or changing value that wouldn’t exist if it was open information. 

If that secret is held on any network (online), it’s not hack-proof.

