@madcatgrin @Best2Q @jennycohn1 Ergo: #HandMarkedPaperBallots counted observably in public.

It can still be a secret ballot. You just can't place a computer (e.g., barcode ballot-marking device) in between the voter and their ballot.

Tracing votes back to individual voters is an absurdly inefficient protocol.

